import { Link } from "react-router-dom";
import React from "react";
import "../Styles/DropDownElev.css";

function DropDownElev() {
  return (
    <div className="hamburger-container">
      <input type="checkbox" id="menu-toggle" />
      <label htmlFor="menu-toggle" className="hamburger-button">
        <span></span>
        <span></span>
        <span></span>
      </label>

      <nav className="side-menu">
        <ul>
          <li>
            <Link to="/profilElev">Profil</Link>
          </li>
          <li>
            <Link to="/ajutorElev">Ajutor</Link>
          </li>
          <li>
            <Link to="#">Iesi din cont</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default DropDownElev;
